import Navbar from "./Navbar";
import logo from "../assets/img/logo.jpeg.jpeg"

export function Header() {
    return (
        <header className="flex place-content-between items-center position-absolute">
            <img src={logo} alt="logo" className="w-[145px] h-[145px]"/>
            <Navbar />
        </header>
    )
};
